var roRO={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"Permite","Allow in your wallet":"Permiteți-vă în portofel","Allow {symbol} first":["Permiteți mai întâi ",["symbol"]],"Allowance pending":"Alocație în așteptare","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"A apărut o eroare la încercarea de a executa acest swap. Este posibil să fie nevoie să vă măriți toleranța la alunecare. Dacă acest lucru nu funcționează, poate exista o incompatibilitate cu jetonul pe care îl tranzacționați. Notă: taxa pentru jetoane de transfer și rebase sunt incompatibile cu Uniswap V3.","Approval pending":"În curs de aprobare","Approve":"Aprobă","Approve Permit2":"Approve Permit2","Approve in your wallet":"Aprobați în portofel","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["Aprobați mai întâi ",["symbol"]],"Auto":"Automat","Auto Router":"Router automat","Auto Router API":"Auto Router API","Balance:":"Sold:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"Închide","Confirm in your wallet":"Confirmați în portofel","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"Conectare la portofel","Connecting…":"Conectare…","Continue":"Continue","Convert {0} to {1}":["Convertiți ",["0"]," la ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"Deconectați portofelul","Dismiss":"Respinge","Enter an amount":"Introdu o sumă","Error fetching trade":"Eroare la preluarea comerțului","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"Preluare cel mai bun preț…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"Alunecarea mare crește riscul de mișcare a prețurilor","I don't have a wallet":"Nu am portofel","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["Sold ",["0"]," insuficient"],"Invalid recipient":"Destinatar nevalid","Max":"Maxim","Max slippage":"Alunecare maximă","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"Dependențe lipsă","Network fee":"Taxa de retea","No results found.":"Nici un rezultat găsit.","No tokens are available on this network. Please switch to another network.":"Nu sunt disponibile jetoane în această rețea. Vă rugăm să comutați la altă rețea.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"Vă rugăm să introduceți un % de alunecare valid","Powered by the Uniswap protocol":"Funcționat de protocolul Uniswap","Price impact":"Impactul prețului","Price updated":"Preț actualizat","Reload":"Reload","Reload the page":"Reîncărcați pagina","Request rejected":"Request rejected","Review swap":"Schimb de recenzii","Search by token name or address":"Căutați după nume simbol sau adresă","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"Ceva nu a funcţionat corect","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"Succes","Swap":"Schimbă","Swap failed: {0}":["Schimbarea a eșuat: ",["0"]],"Switch network":"Schimbați rețeaua","Switch network in your wallet":"Schimbați rețeaua în portofel","Switching network":"Comutare de rețea","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"Invariantul Uniswap x*y=k nu a fost satisfăcut de schimbare. Acest lucru înseamnă, de obicei, că unul dintre jetoanele pe care le schimbi încorporează un comportament personalizat la transfer.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"Jetonul de intrare nu poate fi transferat. Este posibil să existe o problemă cu jetonul de intrare.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"Jetonul de ieșire nu poate fi transferat. S-ar putea să existe o problemă cu simbolul de ieșire.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Jetonul de ieșire nu poate fi transferat. S-ar putea să existe o problemă cu simbolul de ieșire. Notă: taxa pentru jetoane de transfer și rebase sunt incompatibile cu Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Această tranzacție nu va reuși din cauza mișcării prețurilor. Încercați să vă măriți toleranța la alunecare. Notă: taxa pentru jetoane de transfer și rebase sunt incompatibile cu Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"Această tranzacție nu va reuși nici din cauza mișcării prețului, nici a comisioanelor la transfer. Încearcă să îți sporești toleranța la alunecare.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Termen limită tranzacție","Transaction rejected":"Tranzacție respinsă","Transaction submitted":"Tranzacție trimisă","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Încercați să vă creșteți toleranța la alunecare.<0/>NOTĂ: Taxa pentru jetoanele de transfer și rebazare este incompatibilă cu Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Eroare neașteptată. Nu s-a putut estima gazul pentru swap.","Unexpected issue with estimating the gas. Please try again.":"Problemă neașteptată cu estimarea gazului. Vă rugăm să încercați din nou.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Vizualizare pe Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Avertizare","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Tranzacția dvs. va reveni dacă a fost în așteptare mai mult decât această perioadă de timp.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"Tranzacția dvs. va fi reluată dacă prețul se modifică nefavorabil cu mai mult de acest procent.","minutes":"minute","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," taxa"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { roRO as default };
